import React, { Component } from 'react'
import addArticleIcon from '../create-article.svg'
import selectIcon from '../search-sign.svg'

class Menu extends Component{

	state={
		links: [ addArt, selectIcon ]
	} 



	render(){
			const addIcon = <img src={addArticleIcon} className='icon-style'/>
	const selectIcon = <img src={selectIcon} className='icon-style'/>

		const inMenu  = this.state.links.map((link, index)=>			
			<li key={index}>
				link={link}
			</li>
		)				  

		return(
			<ul>
				{inMenu}
			</ul>
		)	
}
}
export default Menu
